■Ｈ８用ＨＩＤキット（VR4/プレミアム両方に設定あり）
<br>
RG HIDキットでは、H8専用品をご用意しています。<br>

専用バラストは30Wの低ワットタイプを採用、【明るさ】はそのままにバルブの【発熱量を減少】させ、灯具への負担を配慮した新開発のインバータ/イグナイタ一体タイプ。<br>

装着時の作業のし易さも追求。（フォグ装着を前提としたバッテリーハーネスを同梱）。
<br>
RG HIDでヘッドランプとフォグランプ上下の色味を合わせることが可能です（上下同じ色温度商品の場合）。
<br>
※写真はプレミアムモデル
