<br>
【製品特長】<br>
リニューアルされたパワーＨＩＤキット【プレミアムモデル】の特徴は、照明としての基本性能を追求した従来【VR3】の基本性能をそのままに、ヒューズ、リレー、カプラーに至るまで全て防水処理を施した、３年間保証付き、最高級モデルです。<br>
装着後、経年劣化や装着不良による点灯不良を最大限除去しました。<br>
<br>
※「明るさ」「色味」「配光」を科学分析し、製品に活かしております。<br>
「明るさ」「色味」は関連性の深いファクターで、人間工学に基づいた「視認しやすい光」を目標に商品設定がなされました。<br>
「配光」については、ハロゲンバルブ用として設計されている車両側のランプユニットを最大限活かし、ノーマルの配光を崩す事無く、照明光をトレースさせることを実現しました。勿論、車検対応基準を想定した商品設計がなされています。<br>
<br>
シングルシステムについて、ヘッド/フォグを兼用とし実用性と明るさを追求しました。(H8は専用モデルを設定)※1<br><br>
【充実装備のシングル・システム】<br>(H1/H3/H4LO/H7/HB3・4/H9・11/H8)<br>
１・バッテリー・リレーハーネスで確実な電源を確保。
※H4LOにはリレーハーネスは付いておりません。<br>
２・HB3・4/H9・11/H8には専用電源カプラーを装備。<br>
３・導電性に優れる「RG特製接点グリス※」を同梱。※グリスは全システムに同梱<br>
<br>
【基本性能を充実させたHI/LO切替システム】(H4DD)<br>
１・2WAYソレノイドで素早いHI/LO切替。
<br>２・独自設計の背面シェードが理想的な配光パターンを実現。<br><br>
【ワンパッケージタイプ】（全システムに共通）
<br>１・ハロゲン仕様車をHIDに変更する為、必要なパーツを一箱に揃えました。
<br>２・最新設計の国内OEM製小型バラスト（インバータ/イグナイタ別体）を採用。<br>
※H8は30W(低ワット）専用バラストを採用。<br>
３・豊富な色温度設定(2800K※10/4500K/5500K/6300K/6700K/10000K※11)。<br>
<br>
